import json
import pandas as pd

# Step 1: Identify the file containing clinical data
clinical_data_files = []
for file in ['1-s2.0-S0092867420301070-mmc1.xlsx', '1-s2.0-S0092867420301070-mmc2.xlsx', 
            '1-s2.0-S0092867420301070-mmc3.xlsx', '1-s2.0-S0092867420301070-mmc4.xlsx', 
            '1-s2.0-S0092867420301070-mmc5.xlsx', '1-s2.0-S0092867420301070-mmc6.xlsx', 
            '1-s2.0-S0092867420301070-mmc7.xlsx']:
    try:
        df = pd.read_excel(file, sheet_name=None)
        for sheet_name, sheet_df in df.items():
            if 'clinical' in sheet_name.lower() or 'tumor type' in sheet_df.columns.str.lower().tolist():
                clinical_data_files.append(file)
                break
    except Exception as e:
        print(f"Error reading {file}: {e}")

# Step 2: Identify the file containing mutation burden data
mutation_burden_files = []
for file in ['1-s2.0-S0092867420301070-mmc1.xlsx', '1-s2.0-S0092867420301070-mmc2.xlsx', 
            '1-s2.0-S0092867420301070-mmc3.xlsx', '1-s2.0-S0092867420301070-mmc4.xlsx', 
            '1-s2.0-S0092867420301070-mmc5.xlsx', '1-s2.0-S0092867420301070-mmc6.xlsx', 
            '1-s2.0-S0092867420301070-mmc7.xlsx']:
    try:
        df = pd.read_excel(file, sheet_name=None)
        for sheet_name, sheet_df in df.items():
            if 'mutation burden' in sheet_name.lower() or 'variants per mbp' in sheet_df.columns.str.lower().tolist():
                mutation_burden_files.append(file)
                break
    except Exception as e:
        print(f"Error reading {file}: {e}")

# Print the answers
print(json.dumps(
    {
        "subtask-1": clinical_data_files,
        "subtask-2": mutation_burden_files
    }, indent=4
))
